//引入vue和vue的路由
import Vue from 'vue'
import VueRouter from 'vue-router'

//使用vue和vuerouter
Vue.use(VueRouter)

import Home from '@/views/Home'
//创建和导出路由实例
export default new VueRouter({
    routes:[
        {
            path: '*',
            redirct:'/home'
        },
        {
            path:'/home',
            component:Home,
            name:'Home',
        },
        {
            path:'/login',
            component:() => import('@/views/Login'),
            name:'Login'
        },
        {
            path:'/register',
            component:() => import('@/views/Register'),
            name:'Register'
        }
    ]
})
